// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.ResourceRun) predicate.ResourceRun {
	return predicate.ResourceRun(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.ResourceRun) predicate.ResourceRun {
	return predicate.ResourceRun(sql.NotPredicates(p))
}
